package main

import "fmt"

/*
	1st approach:
	- check the counterpart as well as the next counterpart

	e.g.1 abbca
	compare index 0 and 4: a == a
	compare index 1 and 3: b != c, therefore we gonna check if 2 and 3 are the same

	e.g.2 abcca
	compare index 0 and 4: a == a
	compare index 1 and 3: b != c, therefore we gonna check if 1 and 2 are the same

	e.g.3 ucupu upuc <- very important testcase !!!
	compare index 0 and 8: u != c
	the above 2 checks are not enough, because index1 c and index8 c are the same,
	therefore we should also compare the next counterparts s[i+2] and s[j-1]


	Time	O(n)
	Space	O(1)
	24 ms, faster than 96.55%
*/
func validPalindrome(s string) bool {
	i := 0
	j := len(s) - 1
	isConsumed := false
	for i <= j {
		if s[i] != s[j] {
			if s[i+1] == s[j] && !isConsumed {
				if i+2 < len(s) && j-1 >= 0 && i+2 <= j-1 {
					if s[i+2] == s[j-1] {
						i++
						isConsumed = true
						continue
					}
				} else {
					i++
					isConsumed = true
					continue
				}
			}
			if s[i] == s[j-1] && !isConsumed {
				if i+1 < len(s) && j-2 >= 0 && i+1 <= j-2 {
					if s[i+1] == s[j-2] {
						j--
						isConsumed = true
						continue
					}
				} else {
					j--
					isConsumed = true
					continue
				}
			}
			return false
		}
		i++
		j--
	}
	return true
}

func reverseStr(s string) string {
	r := ""
	for i := len(s) - 1; i >= 0; i-- {
		r += string(s[i])
	}
	return r
}

func main() {
	/*
		true
		true
		true
		true
		true

		true
		false
		true
		true
		false

		true
		false
		false
		true
	*/
	fmt.Println(validPalindrome("ab"))
	fmt.Println(validPalindrome("aba"))
	fmt.Println(validPalindrome("abca"))
	fmt.Println(validPalindrome("acba"))
	fmt.Println(validPalindrome("abbca"))

	fmt.Println(validPalindrome("abcca"))
	fmt.Println(validPalindrome("abxca"))
	fmt.Println(validPalindrome("cupuupucu"))
	fmt.Println(validPalindrome("ucupuupuc"))
	fmt.Println(validPalindrome("eeccccbebaeeabebccceea"))

	fmt.Println(validPalindrome("aguokepatgbnvfqmgmlcupuufxoohdfpgjdmysgvhmvffcnqxjjxqncffvmhvgsymdjgpfdhooxfuupuculmgmqfvnbgtapekouga"))
	fmt.Println(validPalindrome("dmaaafad"))
	fmt.Println(validPalindrome("dmaadedaeeddeeadedafad"))
	fmt.Println(validPalindrome(""))
}
